import React from "react";
import './projects.css';
import modeloFoto from './modelo.jpg';

function Projetos () {
    return(
        <div className="principal">

            <div className="projeto"> <img id="modelo" src={modeloFoto} />

            </div>

            <div className="text"><h1 id="texto"> PROJE</h1>Meu primeiro projeto, se baseia em um site de um time da NBA onde temos um header com navegação
                entre: uma local para compras de ingresso, uma galeria de fotos, uma loja com artigos do time e as estatísticas de cada jogador. Em sua home teremos:
                 foto do time, um resumo do ultimo jogo acompanhado por um video de highlights, foto de alguns jogadores e um footer com navegação entre as principais redes sociais.
            

            </div>

        </div>
    )
}

export default Projetos
